The first thing to do is to break down the complicated operators into the most simple ones: MAX, MIN and SM which are generally working on lists of digits. 

We'll start with the first part: 
[SM [MAX 5 [MAX [MIN 7 3 [MAX [MAX 3 0 5 3] [SM 3 6 3 4] 5 8] [SM [MAX 7 2 5 5] [MIN 4 9 5 1] 2 7]] 2 0 [MIN 1 [MIN [MIN 4 0 7 5] 8 [MIN 7 1 9 7] 3] [MIN [MAX 5 6 7 8] [MIN 9 0 3 6] 9 4] 9]]],
which is the sum of some max and min operations with modulo 10.

First, we solve operators inside brackets:

SM 3 6 3 4 equals to (3+6+3+4) mod 10 = 16 mod 10 = 6;
MAX 3 0 5 3 equals to maximum of (3,0,5,3) = 5;
MAX 7 2 5 5 equals to maximum of (7,2,5,5) = 7;
MIN 4 9 5 1 equals to minimum of (4,9,5,1) = 1;
MIN 4 0 7 5 equals to minimum of (4,0,7,5) = 0;
MIN 7 1 9 7 equals to minimum of (7,1,9,7) = 1;
MAX 5 6 7 8 equals to maximum of (5,6,7,8) = 8;
MIN 9 0 3 6 equals to minimum of (9,0,3,6) = 0;

So our expression now looks like this:
SM 5 MAX 7 3 MAX 5 6 5 8 SM 7 1 2 7 2 0 MIN 1 MIN 0 8 MIN 1 3 MIN 8 0 9 4 9. 

Next, we simplify further:
MAX 5 6 5 8 equals to maximum of (5,6,5,8) = 8;
SM 7 1 2 7 equals to (7+1+2+7) mod 10 = 17 mod 10 = 7;
MIN 0 8 equals to minimum of (0,8) = 0;
MIN 1 3 equals to minimum of (1,3) = 1;
MIN 8 0 equals to minimum of (8,0) = 0;

We subtitute that back into the expression and then keep simplifying:

SM 5 MAX 7 3 8 7 2 0 MIN 1 0 1 0 9 4 9
MAX 7 3 8 7 equals to maximum of (7,3,8,7) = 8;
MIN 1 0 1 0 equals to minimum of (1,0,1,0) = 0;

Now it looks much simpler: SM 5 8 2 0 0 9 4 9, and we ultimately find this to be
(5+8+2+0+0+9+4+9) mod 10 = 37 mod 10 = 7. 

This is the result of the first part of the expression. 

For the second part of the expression and the rest of it, you would follow the same steps as above. Once you get results for each part, you then perform the operation at the highest level, which is another sum modulo 10, and voilthere's the result!
